import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import AuthPage from './pages/AuthPage';               // Registration Page
import LoginUI from './pages/LoginUI';                 // Login Page
import Dashboard from './pages/Dashboard';             // Dashboard (Protected)
import NewInCanadaChecklist from './pages/NewInCanada'; // Newcomer Checklist (Protected)
import PrivateRoute from './components/PrivateRoute';  // Route Guard

function App() {
  return (
    <Router>
      <Routes>
        {/* Registration Route */}
        <Route path="/" element={<AuthPage />} />

        {/* Login Route */}
        <Route path="/login-ui" element={<LoginUI />} />

        {/* Protected Dashboard Route */}
        <Route
          path="/dashboard"
          element={
            <PrivateRoute>
              <Dashboard />
            </PrivateRoute>
          }
        />

        {/* Protected Newcomer Checklist Route */}
        <Route
          path="/new-in-canada"
          element={
            <PrivateRoute>
              <NewInCanadaChecklist />
            </PrivateRoute>
          }
        />

        {/* 404 Fallback */}
        <Route
          path="*"
          element={
            <div className="p-10 text-center text-xl text-red-500">
              404 - Page Not Found
            </div>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
